import React from 'react';
import { users } from '../data/feedData';
import Thread from './thread';
import sortedThreads from '../helperFunctions/helperFunctions';
import '../css/feed.css';

export default class Feed extends React.Component {
  render() {
    return (
      <div className="feed">
        {sortedThreads.map((thread) => (<Thread title={thread.title} messages={thread.messages} users={users} />))}
      </div>
    );
  }
}
